import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Register extends Component {
    constructor() {
        super();
        this.state = {
            username: "",
            email: "",
            password: "",
            password2: "",
            errors: {}
        }
    }
}

export default Register;
